import React, { useState, useEffect }  from "react";
import { Container, Row } from "react-bootstrap";
import ListElem from "./ListElem";
import apiClient from "../apiClient";
import NavHeader from "../header/NavHeader";
import { array } from "prop-types";

const Archive = (props) => {

        const [bookings, setBookings] = useState([]);
        const [user, setUser] = useState(null);
        const [bookingArray, setBookingArray] = useState(bookings);

    useEffect(() => {
        const fetchGet = async () => {
            const response = await apiClient.get("api/v1/booking/archive").then(() => {
                setBookings(response.data);
                setBookingArray(makeRow(bookings, 3));
        })
            
        }
        const makeRow = (array, size) => {
            const result = [];
            for (let i = 0; i < array.length; i += size) {
                result.push(array.slice(i, i + size));
            }
            return result
            console.log(result)
        }

        setUser(props.user);

        fetchGet();

        setBookingArray(makeRow(bookings, 3));
    }, []);    


    console.log(bookingArray);
    return (
        <>
        <NavHeader user = {user}/>
        <Container>
            {bookingArray.map(
                elem => {
                return <Row>{elem.map(col => <ListElem booking = {col}/>)}</Row>
                }
                )
            }
        </Container>
        </>
    )
}

export default Archive;
